import Cookies from 'universal-cookie';
import { useNavigate, Link, } from 'react-router-dom';



  
  function GuestGreeting(props) {
    return <Link to="/welcome">Home</Link>;
  }

  ReactDOM.render(
    // Intentar cambiando isLoggedIn={true}:
    <GuestGreeting isLoggedIn={false} />,
    document.getElementById('root')
  );
class Renderizado extends React.Component {
   
    render() {
     
      let button;
 
        button =   <li>
        <Link to="/permisos" >Permisos</Link>
      </li>;
  
      return (
        
         <li>
                 {button}
         </li>
      
        
      );
    }
  }
  ReactDOM.render(
    <Renderizado />,
    document.getElementById('root')
  );
export default Renderizado;
